import React from "react";
import SideBar from "../SideBar/SideBar";
import Header from "../Header/Header";
import "./Search.css"

export default function Search(){

     

    return(
        <>
          <div className="main">
            <div className="search">
                <input type="text" />
            </div>
            <Header />
            <SideBar />
          </div>
        </>
    )
}
